import React from "react";
import blastoies from "../src/images/blastoies.png";
import './Home.css';
import { NavLink } from "react-router-dom";

const Home =()=>{
  return(
    <>
    <section id='header'className="d-flex align-item-centre">
      <div className="container-fluid nav-bg">
      <div className="row">
      <div className="col-10 mx-auto">
        <div className="row">
      <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-centre flex-column">
      <br></br><br></br><br></br><br></br>
      <h1 className="mx-auto">Login</h1> 
      </div>
      <div className="col-lg-6 order-1 order-lg-2 header-img">
      <br></br><br></br><br></br>
        <img src={blastoies} className="img-fluid animated" alt="home img"
        style={ {
          width:'100%',
          }}
        />
      </div>
      </div>

      <br></br><br></br>

      </div>
      </div>
      </div>




      </section>
    </>
      );
};

export default Home;
